ro huna sakne samavawana xa party , social work wa sathi sagaa ko ghum ghaam ma vetnna sakne samvwnaa xa ,,,, 2021 6 wa 9 sammma ma jupiter ko support ma vetnna sakne ra samavnadha ramro babauna ek aaps ma understanding maa aagadi badhnu vyaema relaiton romantic huna sakne samavnwaa xa kundali ma JUPITER, MERCURY , SUN ko suport le anya jeewan ko xetra haru bata pani ramro huna sakne samavawana xa .\n',5,132,2,106),(141,'2021-03-30 11:27:43.104000','2021-03-30 13:54:01.434000','Hajur  milansar sahayogi , chanchal , dayalu sovab ...  kundalimaa JUPITER , venus, mercury, mars ko support le jeewan ma derai ramro huna sakne mihinet gareko  xetra ma safal hune maan samman pani milne yog ho tara rahu ko asrrr le jeewan ma derai struggle vane garnu parne hunchha  padhai ko xetra derai ramro x jasle gardaa aafno desh maa pani ramro hune samvawana x ra bidesh jane soch vayemaa South direction maa jadaa derai ramro hune..IT, software , technical , marketing ,online banking , media xetra pani ramro x 2021 6 wa 11 ko samay bidesh jana ko lagi ramro dekhinxhh vane 2023 10 wa 2024 4 paxi ko samay sabai xetra bata derai ramro hune safal hune samvawaa mars ko supprt le ....mann derai chanchal huna sakne samvawnnaa x so aafu ali derai careful vayer aagadi badhnnu ramro hune x... ',5,139,2,122),(142,'2021-03-30 11:50:36.417000','2021-03-30 14:07:39.648000','Hajur sahahasi boudhik mihineti immandar sovab ko byakti...  uhaako kundali herda uhaa shoukhin, dayalu, saral, sahayogi vawanaako, kamuk   dekhinu hunxh ,,, 2017 2018 ma  health jeewan ra aarthik pakshya ma badha aayeko huna sakne,,,   uha ko kundali maa herda sun, mercury , jupiter ko supprt le jeewan ramro huna sakne ho kundali madhyam x manxey ko sovab ra byabahaar ramro hudaa jeewaan maa aaiparne dukha haru ko samana garna sakne ho,,,   budhaditya Yog  jasle samajik xetraa  ma name frame banaune yog pani x .. sofial sector banking , online , marketing , teaching , xetra ma ramro huna sakne samvawnaaa x ra naya aawasarr haru pani 2021  5 wa 7 ma aantar dasa ma Sun ko support le milna sakne ra family ra finincial xetra haru maa pani ramro hudai jana sakne samvawana x rahu ko asssrr le jeewan ma struggle derai nai garnu parne hunx aile ko samay ma pani saturday veeg khane gariv dukhi laai black clothes wa khan pin ko saman haru donate garnu vayemaa pani derai ramro huna sakne samvvawana  x 2022 2 wa 7 dekhi Moon ko mahadasa ko support le jeewan ko sabai xetra ma ramro hudai jane samvawana x vane   2025 2026 sammma maa jupiter le social xetraa bata pani ramro hune samvawna x.... aile ko job ke ma raicx sodeko vaye hune  ailey samay garo  x rahu ko pani assr x ra mind concern pani vayeko xaina aafu careful vayerrr aagadi badhnnu hola',5,140,2,128),(147,'2021-03-30 15:58:35.838000','2021-03-30 16:51:35.167000','chart ma herda jupiter sun  ra mercury ko support ma jeewan ramro huna sakmne mihinet gareko xetra ma safal huna sakne  vabishya ma name frame pani bauanaa sakne samavnwa pani xa  MARS  ko weak   asrr le garda jeewan ma derai struggle ko  samaye vane aauna sakne huda pani aafu careful vayerr nai aagadi badhnu hola ,,,, banking , teaching , saishik , online , media , banking , xetra ma career jeewan ma ramro huna sakne ra samajaik social xetra ma pani ramro huna sakne samavnwaa  xa  FININCIAL , FIMAILY , SOCIAL , RAJNITIK ,  xetra bata pani name frame ramro huna sakne samavnwaa xa 2021 7  wa 10  dekhi hajur ko career jeewan ma ramnro  badhlaav hudai jana sakne samavwnaa xa   tapaein EAST NORTH  side ma sarda ramro huna sakne samavwwna  xa 2022 5 wa 7 tira ko samaye ma mercury ko  suppoet le garda  basaai sarda ramro huna sakmne samavwan xa  tapaien derai chanchal , kamuk byakti ho  ra aru lai xittto believe  garne sovaab huda jheewan ma  kei kisimkaa badaha haru pani aauna sakxan aafu careful ra dhairya vayerr aagadi badhnu ramro hune xa ,,  ra bihe ko lagi 2021 11 wa 2022 4 tira ko samaey ma bihe ko lagi ramro samye dekhinchah mercury ra jupiter ko support le ra bihe paxi ko jeewan sabia xetra ma ramro  ra safal huna sakne samavnwa pani  xa ,, uu hajur vanda 6,7 year  junier huna sakne samawvnaa xa ,, bihe paxi ko jeewan bidesh ma settle hune samvawanaa derai xa ,,,,, ra bidesh ko lagi  pani  NORTH EAST side  ma  2022 5 wa 7 ko samaye ma jane ra settlement ko samvawana xa ,,, aafu careful dhairya vayerr mihinet gariaagdi abdhnu ramro hune xa ,,,(settlement bihe  paxi ko samye ma nai diyeko xu)  2025 9 wa 12 samma ma  sabai xetra ma jeewan derai ramro hudaijana sakne  settlement huna sakne samavwna xa  MERCURY ko support xa ,,,  jeewan ramro banauana ko lagi tuesday veeg khane ra gariv dukhi lai donate garne ra  Om an angarkaya namah: daily 108 mantra japp garnu vayema ramro hune xa .',5,146,2,106),(155,'2021-03-31 05:22:56.437000','2021-03-31 05:58:10.157000','Yes bisaye ma hajurko ahile ko time RAHU ko time xa ra hajurko 7th house ko lord SATURN ho jasle pani  ahile veteko sanga  long time nai jane khalko xaina kehi time ka lagi hajur haru bich ma najic vayeko ho ra usko ahile ko time alli strong huna shakxa jasle hajur sanga dherai najic vayeko  ra hajurlai pani yo prati dherai feelings aaune ra   najic hune vai raheko xa  but  yo nai soulmate huen ra  agadi badne cahcne chai alli kam xa ra usle pani afno   personal life lai agadi badauna khoji raheko xa so tyo hisab ma hajurle pani ramro sanga care garne ahile shanibar veg khana kahne yek arka bich ma samajdari vayera yek arka ko vabana bujera agadi badne ho vane chai 021 5 and 7 ma MERCURY le kehi chacne xa najic hune but  future husband nai vane hajurle alli paxi yo 022 1 and  5 ma MOON ko time ma  WEST  tira ko , meheanti, sahasi , sahayogi , parakrami , jidhdhi , sahasi , boli bachan ma ramor ,  hune ra uslai kam  sathi vai  and online ko madhyam bata nai vetnu hune xa ra yo sanga  relatoinship balla ramor hudai janxa......',5,154,2,122),(160,'2021-03-31 11:48:40.719000','2021-03-31 15:54:41.818000','1st house ko lord MERCURY le sahasi , meheanti , baudhdhic , parakrami ,,,,,, 012 013 ma p