nk you',NULL,1,2,106),(119,'2021-03-23 23:25:55.708000','2021-03-30 10:22:55.595000',5,'my ex will return?wat can i expect?he is avoiding me,we don\'t talk for weeks.5th time broken.wat his feelings and thinks nd plans for us?is he conformed and moving on?',NULL,1,3,99),(123,'2021-03-28 18:26:17.805000','2021-03-30 10:47:13.061000',5,'hello. Im planning to immigrate in an another country.  Will i be able?\nplease give me an accurate answer of it.',NULL,1,2,122),(129,'2021-03-30 04:48:55.337000','2021-03-30 11:15:22.888000',5,'please tell in this chart (2 August 1986,11:40PM, rewari, haryana,india)problem in current job,want to change it,have one offer but salary is low,what should do,any other offer in near coming months,should take this, job stability,please check and answer in detail',NULL,1,2,128),(145,'2021-03-30 14:56:44.244000','2021-03-30 15:19:54.534000',5,'What does my chart tells about my destiny? When will I see very important and drastic changes in my life? What are these changes? Will I become very successful and rich? Will I relocate  and work abroad? What are my strengths and weaknesses? Will I definitely meet my soulmate this year only? What is her age? When will I get married? Is she living close to my vicinity? Will I marry and relocate abroad? \nThank you',NULL,1,2,106),(152,'2021-03-30 18:16:44.528000','2021-03-31 04:19:33.569000',5,'hello. My full name is Leea Luchmee Fokeer. \nDob is 24 april 2001 and i am female. im born at 3.15 p.m and Born in Quatre-Bornes,Mauritius.\nIn fact, last year in december 2020 i had my first kiss with a guy and it was so unexpected, i was only attracted with him and not in love but then i started having feeling for him and he too but he told me that it is advisable for us to have our separate ways for now cause he has to focus on his future. i dont get it what was the purpose he came into my life but now he does not want me? Should i wait for him? is he my soulmate? I want to know in details about my future husband. who is my soulmate/husband and where will we meet?',NULL,1,2,122),(158,'2021-03-31 09:36:09.633000','2021-03-31 11:40:40.740000',5,'hello i wanted to ask about my love life been in love with a guy named Avinash Bhowany since five years(his dob 23 october 1994) started to have small clash between us then i got to know a guy named varun online but nothing happened we just talked as friend but now we are not in contact but on the 31st december 2020 my supervisor friend Yeshav Hurry (his dob 14 May 1998)was at my workplace he started to ask about me and they gave him my social media name to chat with me then we started talking on the 7th of january we went out for a drive nothing happened we only talked ate & then back home he used to call me every hour take care of me tells me that he will marry me be here for me forever will give me all happiness bit when a guy friend (my collegue)of mine found out that we were talking he told me no not him as he will used me only for his desire and leave me afterwards after that things got complicated we stopped talking then on the 11 or 12 of march he call me told me that he wants to be here for me wants to marry me etc.. but recently for about 2 days we started ignoring each other what is his intention? also i want to know if my soulmate is Avinash if he loves me ?if we will have a chance to go ahead in our life? my name Neeshita Bhujun 16 july 1997 time of birth 10:40 am',NULL,1,2,157),(162,'2021-03-31 20:02:38.134000','2021-03-31 21:15:01.112000',5,'please tell in this kundali( 18 November2013, 2:20 AM, Los Angeles, California,USA)virgo Lagan chart h,please tell about lifespan, aayu kitni h,some reason so asking this, please check this in detail regarding longevity, any danger to life, please I request you, I\'m not asking exact number of age just approximate tell, please',NULL,1,2,128),(171,'2021-04-02 05:34:49.467000','2021-04-02 05:41:09.165000',165,'Hi, I really appreciate your detailed answer, please tell in previous Kanya