ifficulty in taking major decisions which is your nature as per the chart analysis. In regards to meeting your soulmate, you are likely to meet your future partner around the month of June  2021, should there be any delay, you shall meet him in September  2021 in the time of Jupiter. She is likely to be from the West direction of your birthplace but you shall meet her in a social gathering through your close friends or relatives or during your work life. We cannot be very specific about her attributes but she is likely to be of average height, a beautiful girl who shall understand you and support you in your future endeavors too. She may be a bit proud & stubborn but at the same time she seems kind, loyal and she shall love you and accept you for who you are and expects you to be the same and this would be a long-lasting relationship you are looking for. The position of Mars may bring some ups and downs in your relationship hence, it is advised for you to be cautious while handling arguments and misunderstandings and this is also the reason you haven\'t been able to meet her till now. You may not have met or spoken to her earlier but you could have seen her somewhere so you may have that familiar feeling when you meet her and she may feel the same. She may be involved in a business of her own or a job in a political sector and she seems to be financially stable too. She would belong to a religion and race similar to yours so you both would have similar cultural taste. Also, she does not seem to be married or divorced but single for some time. and If you have someone in your mind, you may send the birth details (date, time, and place of birth) or the first date you met, for the compatibility check. Best wishes.',133,8,5,'NotRegistered',NULL,5,'What is the maximum time frame of meeting my soulmate? Latest month?is she living in my vicinity, have I seen her several times before, how will I meet her through friends, family or work? What are her physical characteristics, hair, face,tall, style, personality, is she very beautiful and loves me a lot? Her age, height, job, is she rich? Her religion, race, ethnicity same like me. Is she known to me already? Will I definitely meet her this year? Latest month? Is she separated, divorced or unmarried? Signs to identify her? Why I am not able to meet her? Similarities between us?how will I connect with her? Precise physical characteristics of my soulmate? Thank you',107,NULL,0,106),(143,'2021-03-30 13:54:01.886000','2021-03-30 13:54:01.886000','Dear Leea, Warm regards. The observation of your natal chart shows the alignment of planet Jupiter, Venus, Mercury, and Mars which are supportive of your overall career, finances, abroad settlement, and future success in your life. The presence of Rahu may bring some obstacles and delays in progress and you may have to struggle in some phases of life too hence, it is advised for you to follow a vegetarian diet on Saturdays, and donate Black clothes, Food to reduce its effects and bring positivism in your life. You could do well in your own native country too but if you desire to go abroad, it is suitable for you to immigrate to a different country, the month of June and November  2021 shall bring some good opportunities to travel abroad to your desired country. The month of October 2023 and April 2024 shall further bring stability and smooth financial flow in your life in the foreign land and you wouldn\'t have to look back from then. Best wishes.',141,8,5,NULL,'0:1617112441816614%e1a458abe1a458ab',5,'hello. Im planning to immigrate in an another country.  Will i be able?\nplease give me an accurate answer of it.',123,NULL,1,122),(144,'2021-03-30 14:07:40.380000','2021-03-30 14:07:40.380000','Dear Kalpana, Warm regards. The observation of the natal chart (2 August 1986,11:40PM, Rewari, Haryana, India) shows that he is an honest, hardworking, courageous, and intelligent individual who has the ability to do well in his career and fulfill his goals. Th